def compute_tr(pk):
    bit_string = bytes_to_bits(list(pk))

    shake = SHAKE256_XOF()
    shake.new(bits_to_bytes(bit_string))  
    # shake.new(bytes_to_bits(list(pk)))
    tr = shake.read(64)  # 512 bits = 64 bytes

    return tr

